const dataDetailStyle = {
  display: "inline-block",
  padding: "10px 0 10px 0",
};

const bListliStyle = {
  display: "inline-block",
  paddingRight: "10px",
};

const buttonStyle = {
  background: none,
};

export default {
  buttonStyle,
  bListliStyle,
  dataDetailStyle,
};
